import { StatusBar } from 'expo-status-bar';
import { useEffect, useState } from 'react';
import { StyleSheet, Text, View, ActivityIndicator, Button, TextInput } from 'react-native';
import styles from '../styles'


function Cadastro(){

    const [titulo, setTitulo] = useState(null);
    const [conteudo, setConteudo] = useState(null);

    function cadastrar(){
        console.log('Titulo: ' + titulo);
        console.log('Conteudo: ' + conteudo);
    }    


    return (
        <>
        <View>
            <Text>TITULO</Text>
            <TextInput onChangeText={(titulo)=>setTitulo(titulo)} />
        </View>
        <View>
            <Text>CONTEUDO</Text>
            <TextInput onChangeText={(titulo)=>setConteudo(conteudo)} />
        </View>
        <View>
            <Button onPress={()=>cadastrar()} />
        </View>
        </>
    );
}

export default Cadastro;
